(set.size()).toString()  //\u6d6a\u8d39\u4e00\u4e2aint\u5185\u5b58\n```\n\n\u6b63\u786e\u793a\u4f8b\uff1a\n\n```\nInteger.toString(set.size())\n```\n\n**\u5b57\u7b26\u4e32\u8f6c\u6570\u5b57**\n\n```\nint v = Integer.valueOf(str).intValue(); //\u6d6a\u8d39\u4e00\u4e2a\u5185\u5b58\nint w = Long.valueOf(Double.valueOf(str).longValue()).intValue(); //\u6d6a\u8d393\u4e2a\u5185\u5b58\n```\n\n\u6b63\u786e\u793a\u4f8b\uff1a\n\n```\nint v = Integer.parseInt(str);\nint w = (int) Double.parseDouble(str);\n```\n\n**\u6ca1\u6709\u5229\u7528\u4e0d\u53ef\u53d8\u5bf9\u8c61**\n\n```\nzero = new Integer(0);\nreturn Boolean.valueOf("true");\n```\n\n\u6574\u6570\u548c\u5e03\u5c14\u503c\u90fd\u662f\u4e0d\u53d8\u7684\u3002 \u56e0\u6b64\uff0c\u521b\u5efa\u8868\u793a\u76f8\u540c\u503c\u7684\u591a\u4e2a\u5bf9\u8c61\u662f\u6ca1\u6709\u610f\u4e49\u7684\u3002 \u8fd9\u4e9b\u7c7b\u5177\u6709\u7528\u4e8e\u5e38\u7528\u5b9e\u4f8b\u7684\u5185\u7f6e\u7f13\u5b58\u3002 \u5728\u5e03\u5c14\u7684\u60c5\u51b5\u4e0b\uff0c\u751a\u81f3\u53ea\u6709\u4e24\u4e2a\u53ef\u80fd\u7684\u5b9e\u4f8b\u3002 \u7a0b\u5e8f\u5458\u53ef\u4ee5\u5229\u7528\u8fd9\u4e00\u70b9\uff1a\n\n```\nzero = Integer.valueOf(0);\nreturn Boolean.TRUE;\n```\n\n**\u5e73\u53f0\u76f8\u5173\u7684\u6587\u4ef6\u540d**\n\n```\nFile f = new File(path +\'/\'+ filename);\n```\n\n\u6b63\u786e\u793a\u4f8b\uff1a\n\n```\nFile f = new File(path + File.separatorChar + filename);\n```\n\n**\u672a\u5b9a\u4e49\u6d41\u7f16\u7801**\n\n```\nReader r = new FileReader(file);\n```\n\n\u6b63\u786e\u793a\u4f8b\uff1a\n\n```\nReader r = new InputStreamReader(new FileInputStream(file), "ISO-8859-1");\n```\n\n**\u672a\u7f13\u5b58\u6d41**\n\n```\nInputStream in = new FileInputStream(file);\nint b;\nwhile ((b = in.read()) != -1) {\n   ...\n}\n```\n\n\u4e0a\u9762\u7684\u4ee3\u7801\u9010\u5b57\u8282\u8bfb\u53d6\u4e00\u4e2a\u6587\u4ef6\u3002 \u5bf9\u6d41\u7684\u6bcf\u4e2aread\uff08\uff09\u8c03\u7528\u90fd\u4f1a\u5bfc\u81f4\u672c\u5730\uff08JNI\uff09\u8c03\u7528\u5230\u6587\u4ef6\u